import React, {Component} from 'react';
import ReactDOM from 'react-dom';

class Reactdom extends Component{
    
    // myElement(){
    //      var container= document.getElementById('MyEle');
    //      var MyElem= <h2>This is container and elenent it's render ReactDOMe.</h2>
    // }
    
    render(){
        return (
        <div>
            <button>cheng</button>
            <h2 id="">my name is ismail</h2>
        </div>
        );
    }
}
export default Reactdom;

ReactDOM.render(
    <React.StrictMode>
      <Reactdemo></Reactdemo>
    </React.StrictMode>,
 
    document.getElementById('root')
  );
